\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"dbcd3cd2-5e32-4986-9fca-e0008fe1ce59\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"Concepts to Learn\"},{\"content\":{\"params\":{\"text\":\"<p><em>At the end of this lesson, pupils will be able to:</em></p>\\n\\n<ol>\\n\\t<li>Practise using layers in editing an image,</li>\\n\\t<li>Resize, rotate, move, and other layer manipulation techniques to edit an image.</li>\\n</ol>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"10643b55-0bc9-4c23-b178-cd9d4ba6b8e6\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"title\":\"Learning Outcomes\"}],\"hTag\":\"h2\"},\"library\":\"H5P.Accordion 1.0\",\"metadata\":{\"contentType\":\"Accordion\",\"license\":\"U\",\"title\":\"Lesson Overview\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Lesson Overview\"},\"subContentId\":\"b4add59f-0e62-47e6-892f-896d5211d417\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h2><strong>The Big Picture</strong></h2>\\n\\n<p>Tables are a feature often used in a document. Tables are used in word-processed documents to present information in a structured way. They can hold text and/or images and can be used to present related data in rows (horizontal) and columns (vertical). The rows and columns form boxes, called cells.</p>\\n\\n<p>The benefits of using tables in documents are:</p>\\n\\n<ul>\\n\\t<li>Displaying the most relevant information for easy access</li>\\n\\t<li>Grouping of related information</li>\\n\\t<li>Visual presentation of information, making it easier to understand</li>\\n\\t<li>Adding visually interesting elements to the page</li>\\n</ul>\\n\\n<p>Tables are easy to insert and use in any document, but in this subtopic, you will learn how to adjust your table settings to have the maximum impact on your documents.</p>\\n\\n<p>As for this lesson,most of this section is based on Microsoft Word 365. However, if you are using a different word-processing application, you should be able to follow the features presented in this section.</p>\\n\\n<h2></h2>\\n\\n<h2><strong>Working with Tables</strong></h2>\\n\\n<p>The first step you need to know is how to create a table with a specified number of rows and columns.You need to locate the Table button on the Insert ribbon. As shown in <strong>Figure 1</strong>, using the downward arrow below this button allows you to drag the mouse to select the number of rows and columns you want in your table. In this example it will be four rows and three columns.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"bf8971ed-5379-477b-8a47-2119ce84b56b\"},\"useSeparator\":\"enabled\"},{\"content\":{\"params\":{\"decorative\":true,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA6oAAAG9CAIAAACTUhxDAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsIAAA7CARUoSoAAAG4SSURBVHhe7d0JfBTl/fjxTcIhAooEQQGRAEmQw59aFcKhERG0ARW07d+jopar+tOWiEkUrVpEARVa/Vm5qmK1tlXxSqocRpQjIFYtlyQLBBEiVwA55Ezy/+4+T4bJXtlNdie7mc+beS3P88yxs8/OPPPdJ8/Oxh088KMDAAAAsId4/T8AAABgA4S/AAAAsBHCXwAAANgI4S8AAABshPAXAAAANkL4CwAAABsh/AUAAICNEP4CAADARgh/AQAAYCPhCX83bdr0i5tvKlheIGlJSFaVA0EyH0KoKx9++IG8C2PHjNZ5mHi3cvX7oI2JVxfrb4E6kHQGgIVq+KPHctLqlMMxZMjQEXfeqTPuWZOnTO3cubPOW857B+p8l4L3yIQJ8vjkpEkqG0ZzX301N/fDt95+R+fDzXxIiFipcH+sOWYseJaQ3hcJfEeMuCutT5rO11NSJ3369BmX+YDOV5Lo/7W5c4N5R6w5PGovpHc/mknD2Kt3r6FDr9d595u1csXKSDSVteF9YAQ+VGLlQALqn5r3/spJK7GUTObYF3ZmHBJ3jBiRk50l1yc9A3XK433Rpb6Ulpa2btNaZ+q15cuXe/e65eXmJiYm6kx9Efy7H80k9pVgV2fcJJuRMURnACBEYRv7K59ivS8n8pFdymWKnj9OTZ/2nNol8194Jav+7KsS5rReoi5eizzX3Fdflf30eF4pVCUyGXVulMhco0QtKVtQXb+qUGpALRA5Q4deL9daCSZ03lftSUKVyKRKJGG8HGN59RJUuSR8vjXWMJ7aeHbZSWM35OUYR5S/Y8z8Zn3+2WfyKGmJSGQ7qjzSVOeZdyXLzkuhsT/GEeL9rqm0PBovze cell.</p>\\n\\n<h2><strong>Editing a table</strong></h2>\\n\\n<p>Sometimes you need to adjust the size of a table to make it fit your document, to remove empty cells, or to add or delete entire rows or columns. By right-clicking on the table you can access a pop-up menu that allows you to insert, delete, merge or split cells. These options will depend on whether you have selected a single cell, a row or column, or the entire table.</p>\\n\\n<ul>\\n\\t<li><strong>Inserting rows or columns</strong><br />\\n\\tWhen inserting new rows or columns, you can choose whether to insert them before or after the selected cell/row/column.<br />\\n\\t</li>\\n\\t<li><strong>Deleting cells, rows or columns</strong><br />\\n\\tDelete options will change depending on whether you have selected a single cell, a row or column, or the entire table. If you delete a single cell you will have to choose how the surrounding cells will move to fill the gap.<br />\\n\\t</li>\\n\\t<li><strong>Merging and splitting cells</strong><br />\\n\\tWhen you select multiple cells and choose <strong>Merge Cells</strong>, the cells will be combined into one large cell. If they contained any information, the contents of only the top-left cell will appear in the merged cell (the contents of the other cells you merged will be deleted).<br />\\n\\t<br />\\n\\tSelecting a single cell and choosing to <strong>Split Cells</strong>will allow you to create multiple rows and columns from a single cell.</li>\\n</ul>\\n\\n<h2><strong>Formatting a table</strong></h2>\\n\\n<p>By right-clicking on the table, you can also select <strong>Table Properties</strong>to gain access to many useful table formatting options.</p>\\n\\n<p>A new menu pops up with a variety of formatting options, as shown in <strong>Figure 3</strong>.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"2764e1a4-b95c-4177-9ac5- ong>. This is particularly useful when you want to highlight certain data in a cell or group of cells.<br />\\n\\t</li>\\n\\t<li><strong>Row tab</strong><br />\\n\\tThis allows you to change the <strong>row</strong><strong>height</strong>, either to a specific value or to automatically adjust the row contents.<br />\\n\\t</li>\\n\\t<li><strong>Column tab</strong><br />\\n\\tWhen your text or object doesnt fit in a cell, you can change the <strong>column width</strong>here. This can be set to a specific value, or left unchecked it will automatically adjust to the contents and to the page width, depending on other options selected.<br />\\n\\t</li>\\n\\t<li><strong>Cell tab</strong><br />\\n\\tThis is where you can choose to set <strong>Vertical alignment</strong>within each cell. You can also set a particular cell width if you want this to override the general column width.<br />\\n\\t<br />\\n\\tAlso on this tab is an <strong>Options</strong>button to set<strong>margins</strong>within the cell, and choose whether to <strong>wrap</strong><strong>text</strong>(longer lines of text will turn over onto new lines within each cell) and/or <strong>fit text</strong>(cells automatically adjust size to fit their contents).</li>\\n</ul>\\n\\n<p>The following instructional video demonstrates how to create and edit tables.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"604aeb1c-c276-4a45-8e11-5162a38dd982\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"visuals\":{\"fit\":true,\"controls\":true},\"playback\":{\"autoplay\":false,\"loop\":false},\"l10n\":{\"name\":\"Video\",\"loading\":\"Video player loading...\",\"noPlayers\":\"Found no video players that supports the given video format.\",\"noSources\":\"Video is missing sources.\",\"aborted\":\"Media playback has been aborted.\",\"networkFailure\":\"Network failure.\",\"cannotDecode\":\
